import React, { useState } from "react";
import axios from "axios";
import { response } from "express";

const getSetData = () => {
    axios
    .get("https://api.scryfall.com/sets")
    .then(res => console.log(res.data))
    return res.data
};

getSetData();

let sets = res.data

const SetSelect  = () => {

    return(
        <ul>
            {
            sets.map(sets =>
                <li key = {sets.id}>{sets.name}</li>)
            }
        </ul>
    )
}

export default SetSelect
